SDK::setLanguageEntries('Users', 'LBL_MAIL_LOCKED_LOGIN_BODY', array('it_it' => 'Salve, sono stati effettuati più di %s tentativi di accesso non corretti con la tua utenza dal seguente indirizzo ip %s.<br />Per precauzione abbiamo bloccato l\'accesso del tuo utente da questo indirizzo.<br /><br />Se sei al corrente di questi tentativi falliti e vuoi ripristinare l\'accesso da questo ip clicca %s.<br />Se non sei al corrente di questi tentativi falliti puoi ignorare questo messaggio ed eventualmente sbloccare l\'accesso successivamente contattando l\'amministratore di sistema.<br /><br />Saluti,<br />Lo Staff VTECRM' ,'en_us' => 'Hi, more than %s unsuccessful login attempts were made by this ip address %s with your account name.<br />As security measure, we have locked your account access from this ip.<br /><br />If you are aware of this unsuccessful login and you want to rehabilitate the access from this ip click %s.<br />If you are not aware of this unsuccessful login, you can ignore this message and if you need to rehabilitate it in the future contact your system adminitrator.<br /><br />Regards,<br />VTECRM Team'));
SDK::setLanguageEntries('Users', 'LBL_MAIL_LOCKED_LOGIN_BODY_AS', array('it_it' => 'Salve, sono stati effettuati tentativi di accesso non corretti da più di %s ore con la tua utenza su un dispositivo Active Sync compatibile dal seguente indirizzo ip %s.<br />Per precauzione abbiamo bloccato l\'accesso del tuo utente da questo indirizzo.<br /><br />Se sei al corrente di questi tentativi falliti e vuoi ripristinare l\'accesso da questo ip clicca %s.<br />Se non sei al corrente di questi tentativi falliti puoi ignorare questo messaggio ed eventualmente sbloccare l\'accesso successivamente contattando l\'amministratore di sistema.<br /><br />Saluti,<br />Lo Staff VTECRM' ,'en_us' => 'Hi, unsuccessful login attempts were made from more than %s hours on an Active Sync device by this ip address %s with your account name.<br />As security measure, we have locked your account access from this ip.<br /><br />If you are aware of this unsuccessful login and you want to rehabilitate the access from this ip click %s.<br />If you are not aware of this unsuccessful login, you can ignore this message and if you need to rehabilitate it in the future contact your system adminitrator.<br /><br />Regards,<br />VTECRM Team'));
